import React, { Component } from 'react';
import InputBox from './InputBox/InputBox'
import classes from './Home.module.css'
import logo from '../assests/logo.png'
import Spinner from './Spinner/Spinner'
import jsPDF from 'jspdf'
import axios from 'axios'
import Footer from './Footer/Footer'

const nameVali = /[^a-zA-Z]/
const numVali = /[^0-9]/
const staVali = /[^a-zA-Z\s]/
const emailVali = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/
const apiUrl = "https://localhost:44386/"
class Home extends Component {
  static displayName = Home.name;
  state = {
    maddy: false,
    submitted: false,
    loading: false,
    data: {
      fname: "",
      lname: "",
      address:"",
      mAddress: "",
      email: "",
      cs: "",
      esd: "",
      et: "",
      phone: "",
      pt: "",
      eName: "",
      ePhone: "",
      eRelationship: "",
      Signature: ""
    }
  }
    submitHandler = () => {
        if (this.state.data.fname === "" ||
            this.state.data.lname === "" ||
            this.state.data.address === "" ||
            this.state.data.email === "" ||
            this.state.data.cs === "" ||
            this.state.data.et === "" ||
            this.state.data.esd === "" ||
            this.state.data.pt === "" ||
            this.state.data.eName === "" ||
            this.state.data.eRelationship === "" ||
            this.state.data.ePhone === "" ||
            this.state.data.Signature === "" || (!this.state.maddy && this.state.data.mAddress === ""))

            alert("The whole Form must be filled, thank you:)")
        else if (!emailVali.test(this.state.data.email.toLowerCase()))
            alert("Email Format Error!")
        else {
                this.setState({ loading: true, submitted: false });
                axios.post('https://jsonplaceholder.typicode.com/posts', this.state.data)
                    .then(response => [console.log(response), this.setState({ submitted: true })])
                    .catch(e => console.log(e))
                alert("Submitted!")

        }
            
  }
  pdfGenerator = () => {
      var doc = new jsPDF('p', 'pt', 'a4')
      var pdfWidth = doc.internal.pageSize.width;    
      var pdfHeight = doc.internal.pageSize.height; 
      
      var imgData = 'data:image/jpeg;base64,'
      doc.addImage(imgData, 'JPEG', 0, 0, pdfWidth, pdfHeight)

      doc.setFontSize(13);
      doc.text(150, 157, this.state.data.fname)
      doc.text(400, 157, this.state.data.lname)
      doc.text(150, 190, this.state.data.address)
      doc.text(150, 259, this.state.data.email)
      doc.text(150, 293, this.state.data.phone)
      doc.text(150, 327, this.state.data.cs)
      doc.text(150, 361, this.state.data.esd)
      doc.text(150, 395, this.state.data.et)
      doc.text(150, 429, this.state.data.pt)

      doc.text(150, 501, this.state.data.eName)
      doc.text(150, 529, this.state.data.eRelationship)
      doc.text(150, 560, this.state.data.ePhone)
      if (this.state.maddy) {
          doc.setFontSize(20);
          doc.setFont('Comic Sans','bold')
          doc.text(160, 228, "X")
      }
      else
          doc.text(240, 227, this.state.data.mAddress)
      doc.setFontSize(20);
      doc.setFont('Comic Sans','bold')

      doc.text(205, 641, this.state.data.Signature)


    doc.save("test.pdf")
  }


  render() {
    let mAddy = <div />
    if (!this.state.maddy) {
      mAddy = <div>
          <InputBox text="Mailing Address" change={e => { const { value } = e.target; this.setState(prevState => ({ data: { ...prevState.data, mAddress: value } })) } } content={this.state.data.mAddress} />
      </div>
    }
    let submitt = <button className={classes.btn} onClick={this.submitHandler}>Submit</button>
    if (this.state.loading)
      submitt = <Spinner />
    if (this.state.submitted)
      submitt = <div>
        <button className={classes.btn} onClick={this.submitHandler}>Submit</button>
        <button className={classes.btn} onClick={this.pdfGenerator}>Download PDF</button>
      </div>
    return (
      <div className={classes.home}>
        <img className={classes.logo} src={logo} alt="logo" />
        <h5>Commercial in Confidence</h5>
        <h5>Unauthorised Reproduction Prohibited</h5>
        <h1 className={classes.title}>Employee Creator</h1>
        <InputBox text="First Name" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  fname: value.replace(nameVali,"")}})) } } content ={this.state.data.fname} />
        <InputBox text="Last Name" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  lname: value.replace(nameVali,"") } }))}} content={this.state.data.lname}/>
        <InputBox text="Address" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  address: value } }))}} content={this.state.data.address} />
        <h3>Is the Mailling Address same as above</h3>
        <div className={classes.switch_box}>
          <input type="checkbox" onChange={e => this.setState({ maddy: e.target.checked })} checked={this.state.maddy} className={classes.switch} />
        </div>
        {mAddy}
        <InputBox text="Email Address" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  email: value } }))}} content={this.state.data.email} />
        <InputBox text="Phone No." change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  phone: value.replace(numVali, '') } }))}} content={this.state.data.phone} />
        <InputBox text="Citizenship Status" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  cs: value.replace(staVali, '') } }))}} content={this.state.data.cs} />
        <InputBox text="Employment Start Date" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  esd: value } }))}} content={this.state.data.esd} />
        <InputBox text="Employment Type" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  et: value.replace(staVali, '') } }))}} content={this.state.data.et} />
        <InputBox text="Position Title" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  pt: value.replace(staVali, '') } }))}} content={this.state.data.pt} />
        <h1>Emergency Contact</h1>
        <InputBox text="Name" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  eName: value.replace(nameVali,"") } }))}} content={this.state.data.eName} />
        <InputBox text="Phone No." change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  ePhone: value.replace(numVali, '') } }))}} content={this.state.data.ePhone} />
        <InputBox text="Relationship" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  eRelationship: value.replace(staVali, '') } }))}} content={this.state.data.eRelationship} />
        <h1>Signature</h1>
        <InputBox text="Signature" change={e => {const {value} = e.target; this.setState(prevState => ({ data: { ...prevState.data,  Signature: value } }))}} content={this.state.data.Signature} />
        <div className={classes.btnDiv}>
          {submitt}
        </div>
        <Footer />
      </div>
    );
  }
}
export default Home;
